import os
os.system('clear')
from collections import Counter
class Solution(object):
    def maxOperations(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        numPair = 0
        counter = Counter(nums)
        uniqNum = list(counter.keys())
        uniqCount = list(counter.values())
        while len(uniqNum) > 0:
            num = uniqNum[0]
            diff = k - num
            if diff != num:
                if diff in uniqNum:
                    idxDiff = uniqNum.index(diff)
                    countNum = uniqCount[0]
                    countDiff = uniqCount[idxDiff]
                    numPair += min([countDiff, countNum])
                    del uniqNum[idxDiff]
                    del uniqCount[idxDiff]
            else:
                countNum = uniqCount[0]
                numPair += int(countNum/2)
            del uniqNum[0]
            del uniqCount[0]
        return numPair
